import Nav from "./Components/Nav/Nav";
import DateFnsUtils from "@date-io/date-fns";
import { MuiPickersUtilsProvider } from "@material-ui/pickers";
import { Redirect, Switch, Route, useLocation } from "react-router-dom";
import React from "react";
import Today from "./Pages/Today/Today";
import Home from "./Pages/Home/Home";
import Next3Days from "./Pages/Next3Days/Next3Days";
import SearchDetails from "./Pages/SearchDetails/SearchDetails";

function App() {
  const location = useLocation();
  return (
    <div className="App">
      <Nav />

      <Switch location={location}>
        <Route exact path="/" component={Home} />
        <Route exact path="/home" component={Home} />
        <Route exact path="/today" component={Today} />
        <Route exact path="/future" component={Next3Days} />
        {/* <MuiPickersUtilsProvider utils={DateFnsUtils}> */}
        <Route exact path="/history" component={History} />
        <Route exact path="/search/:location.name" component={SearchDetails} />
        {/* </MuiPickersUtilsProvider> */}
        <Redirect from="*" to="/home" />
      </Switch>
    </div>
  );
}

export default App;
